import styled from 'styled-components'
export const SearchIcon = styled.i`
  font-size: 18px;
  color: #666;
  cursor: pointer;
  margin-left: 15px;
`
export const FormContainer = styled.form`
  input {
    margin-left: 30px;
    height: 30px;
    width: 250px;
    border: 0.2px solid #666;
    border-radius: 20px;
    box-shadow: 2px 2px 2px #666;
  }

  input:focus {
    outline: none;
  }
`
